CREATE VIEW vv_MVP_VOTING_2015_2016
AS
SELECT Voting.Player,Voting.Tm,Standings.Record,Regular.PTS,
Regular.[2P%],Regular.Age,Regular.AST,Regular.BLK,Regular.[efg%],Regular.[FT%],
Regular.G,Regular.MP,Regular.TRB,Advance.PER,Advance.[TS%],Advance.[USG%],
Advance.VORP,Advance.[WS/48],Voting.Share
FROM [NBA_2015-2016_VOTING] as Voting
inner join [NBA_2015-2016_STANDINGS] as Standings
on Voting.Tm = Standings.Team
inner join [NBA_2015-2016] as Regular
on Voting.Player_team = Regular.Player_team
inner join ADVANCED_ANALYTICS_2015_2016 as Advance
on Voting.Player_team = Advance.Player_team



